            for (int i = 1; i <= TotalCustomer; i++)
            {
                
                tblUserMaster um1 = new tblUserMaster()
                {
                    Id = (i*10)+1,
                    IsActive = true,
                    CreatedBy = 1,
                    CreatedDt = _CurrentDt,
                    CustomerId = i,
                    Password = "123456",
                    UserName = "admin",
                };

                tblUserRole ur = new tblUserRole()
                {
                    Id = UserRoles.Count + 1,
                    UserId = um1.Id,
                    CreatedBy = 1,
                    CreatedDt = _CurrentDt,                    
                    Role = i == 1 ? 1 : 2

